import React from "react";
import "../App.css";

function Dashboard() {
  return (
    <div className="dashboard">
      <Card className="mb-3" style={{color:"#000"}}>
        <Card.Body>
          <Card.title>
            This is dashboard card
          </Card.title>
        </Card.Body>
        </Card>
        </div>
  );
}
export default Dashboard;
